    false,nt"url": null,nt"notes": "The imagery posted on this site is of the
    North Carolina coast after Hurricane Ophelia made landfall. The regions photographed
    range from Hubert, North Carolina to Rodanthe, North Carolina. The aerial photograph
    missions were conducted by the NOAA Remote Sensing Division the day after Ophelia
    made landfall, September 17 and concluded September 18. The images were acquired
    from an altitude of 7,500 feet, using an Emerge/Applanix Digital Sensor System (DSS).
    Over 400 aerial images were obtained during this time period, with most available
    to view online and download.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
